import React from 'react';

const Shop = ({data, addToCart}) => {

    return (
        <div>
            <h1>Products</h1>
            <div className='products'>
                {data.map((item, index) => (
                    <div key={index} className='product-item'>
                    <h3>{item.name}</h3>
                    <h4>${item.cost}</h4>
                    <img src={item.image} alt={item.name}/>
                    <br/>
                    <button onClick={() => addToCart(item, 1)}>Add to Cart</button>
                    </div>
                ))}
            </div>
        </div>
    )
}

export default Shop;
